import base64
import os

def create_executable(file_name, base64_data):
    try:
        binary_data = base64.b64decode(base64_data)
    except Exception as e:
        print(f"Error decoding Base64 data for '{file_name}': {e}")
        return

    output_file = f"/bin/{file_name}"
    try:
        with open(output_file, 'wb') as f:
            f.write(binary_data)
    except Exception as e:
        print(f"Error writing file '{output_file}': {e}")

    try:
        os.chmod(output_file, 0o755)
    except Exception as e:
        print(f"Error setting executable permissions for '{file_name}': {e}")


rz = ""
sz = ""
jq = ""

commands = {
    "rz": rz,
    "sz": sz,
    "jq": jq,
}

for file_name, base64_data in commands.items():
    create_executable(file_name, base64_data)
